import styled from "styled-components";

const MyPageContainer = styled.div``;

const StaticInfos = styled.div`
  width: 100%;
  height: 25vh;
  margin: 0rem;
  display: flex;
  flex-direction: column;
  padding: 4rem 5vw;
  font-size: 3rem;
  line-height: 5rem;
`;

const StaticInfo = styled.span``;

const UpdateForm = styled.form`
  padding-bottom: 10rem;
`;

const UpdateHeader = styled.h1`
  font-size: 3rem;
`;

const UpdateLabel = styled.label`
  font-size: 2.5rem;
`;

const UpdateInput = styled.input`
  width: 90vw;
  height: 7rem;
  border-radius: 5rem;
  font-size: 2.5rem;
  justify-content: flex-start;
  align-items: center;
  padding-left: 5rem;
`;

const EmailContainer = styled.div`
  display: flex;
  width: 100%;
  height: 100%;
  justify-content: space-between;
`;
const UpdateInputEmail = styled(UpdateInput)`
  width: 48%;
`;
const EmailOptions = styled.ul`
  width: 48%;
  height: 7rem;
  border-radius: 5rem;
  font-size: 2.5rem;
  padding-left: 5rem;
`;
const EmailOption = styled.li``;

const UpdateBTN = styled.button`
  display: flex;
  height: 7rem;
  align-items: center;
  justify-content: center;
  background-color: var(--orange) !important;
  border: 1px solid var(--dark-brown);
  color: var(--cream);
  font-weight: 600;
  border-radius: 5rem;
`;

function MyPage() {
  return (
    <>
      <MyPageContainer className="container">
        <StaticInfos>
          <StaticInfo>이름: 홍길동</StaticInfo>
          <StaticInfo>회원 등급: 정회원</StaticInfo>
        </StaticInfos>

        <UpdateForm className="form">
          <UpdateHeader>개인정보 변경</UpdateHeader>
          <br />
          <UpdateLabel className="label">
            이메일
            <br />
            <EmailContainer>
              <UpdateInputEmail className="input" type="text" required />
              <span>@</span>
              <EmailOptions>
                <EmailOption>직접 입력</EmailOption>
                <EmailOption>gmail.com</EmailOption>
                <EmailOption>naver.com</EmailOption>
                <EmailOption>daum.net</EmailOption>
                <EmailOption>yahoo.com</EmailOption>
              </EmailOptions>
            </EmailContainer>
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            이전 비밀번호
            <br />
            <UpdateInput className="input" type="text" required />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            새 비밀번호
            <br />
            <UpdateInput className="input" type="" required />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            새로운 비밀번호 확인
            <br />
            <UpdateInput className="input" type="password" required />
          </UpdateLabel>
          <hr />
          <UpdateLabel className="label">
            새 전화번호
            <br />
            <UpdateInput className="input" type="text" required />
          </UpdateLabel>

          <UpdateBTN className="submit_btn" type="submit">
            개인정보 변경
          </UpdateBTN>
        </UpdateForm>
      </MyPageContainer>
    </>
  );
}

export default MyPage;
